勧めパターンは、来島前日までにガイドさんの予約を朝イチにして、朝ごはんを食べずに朝イチの便で大神島へ渡り、ガイドさんの案内で島内観光をし、おぷゆう食堂で「カーキたこ丼」を食べて、宮古島行きの朝イチ便で戻るのがベストだと感じました。\",4,null,\"114620768086520399757\",[\"https://www.google.com/local/review/rap/report?postId\\u003dChdDSUhNMG9nS0VJQ0FnSUN5M0tmTjFnRRAB\\u0026entityid\\u003dChdDSUhNMG9nS0VJQ0FnSUN5M0tmTjFnRRItChZDSUhNMG9nS0VJQ0FnSUN5M0tmTk5nEhNDZ3dJaTRyT2dBWVF5TUxEc0FFGi4KF0NJSE0wb2dLRUlDQWdJQ3kzS2ZOdGdFEhNDZ3dJbE95d2dBWVE0TFA1Z3dFIhIJl9WoAX5O9DQRZqm8HHoBNYsqE0Nnd0lpNHJPZ0FZUXlNTERzQUU\\u0026wv\\u003d1\\u0026s\\u003d81\",\"違反コンテンツを報告\",null,\"0ahUKEwjVieKQztHvAhUGTKwKHYM7AJkQoykIKigCMAA\"]\n,null,null,\"ChdDSUhNMG9nS0VJQ0FnSUN5M0tmTjFnRRAB\",\"0ahUKEwjVieKQztHvAhUGTKwKHYM7AJkQ4R4IJygAMAA\",[null,[[8,null,1]\n,569,4654,\"https://lh3.googleusercontent.com/a-/AOh14GhRMTxBI621i6jDMI4se3gJsU3Qlb1kDjtnGY0kdA\\u003dc0x00000000-cc-rp-ba6\",\"Hide Kage\",\"https://www.google.com/maps/contrib/114620768086520399757?hl\\u003dja-JP\",null,null,\"https://www.google.com/maps/contrib/114620768086520399757?hl\\u003dja-JP\"]\n,\"H\"]\n,null,[[\"AF1QipN5x-X9Od4a01lMTiNAZst_xjijKycgFwzNypvB\",null,null,null,null,null,[\"https://lh5.googleusercontent.com/p/AF1QipN5x-X9Od4a01lMTiNAZst_xjijKycgFwzNypvB\\u003dw150-h150-k-no-p\"]\n,null,null,\"jb1fYJWPH4aYsQWD94DICQ\",\"0ahUKEwjVieKQztHvAhUGTKwKHYM7AJkQzCcIKygDMAA\",[\"//www.google.com/cbk?output\\u003dreport\\u0026cb_client\\u003dmaps_sv.tactile\\u0026image_key\\u003d!1e10!2sAF1QipN5x-X9Od4a01lMTiNAZst_xjijKycgFwzNypvB\",null,null,\"0ahUKEwjVieKQztHvAhUGTKwKHYM7AJkQ-y4ILCgAMAA\"]\n,null,null,null,null,null,null,null,null,null,[[1]\n,[10,\"AF1QipN5x-X9Od4a01lMTiNAZst_xjijKycgFwzNypvB\"]\n,[10,3,[720,1280]\n,null,null,null,null,null,null,\"AF1QipN5x-X9Od4a01lMTiNAZst_xjijKycgFwzNypvB\"]\n,[null,null,null,null,null,null,null,[\"大神島\",\"ja\"]\n]\n,null,null,[2,0,null,null,null,[null,null,null,[6,7,4,1,3]\n]\n,null,[2021,1,23]\n,[2021,1,23,14]\n]\n,[\"//www.google.com/cbk?output\\u003dreport\\u0026cb_client\\u003dmaps_sv.tactile\\u0026image_key\\u
